type Lexer(lb) = 
    let locBuf = ref []
    interface ILexer<string> with        
    
       member self.Get pos = 
        if !locBuf |> List.length >= pos
        then ((!locBuf) |> List.rev).[pos-1]
        else
            let t = tokens lb
            locBuf := t :: !locBuf
            t
       member self.IsEnd () =
            lb.IsPastEndOfStream 
            ||
                let t = tokens lb
                locBuf := t :: !locBuf
                t.name = "EOF"
    end

 
